    private static final String CSS = """           
                                  *, *::before, *::after {
                                    box-sizing: border-box;
                                  }
                                  * {
                                    margin: 0;
                                  }
                                  html {
                                    font-size: 16px;
                                  }
                                  body {
                                    background: #2559a7;
                                    color: #FFF;
                                    display: grid;
                                    font-family: ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, Aptos, Roboto, "Segoe UI", "Helvetica Neue", Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji";
                                    font-size: clamp(1rem, 2.5vw, 2rem);
                                    -webkit-font-smoothing: antialiased;
                                    font-style: normal;
                                    font-weight: 400;
                                    letter-spacing: -0.0025em;
                                    line-height: 1.4;
                                    min-height: 100vh;
                                    place-items: center;
                                    text-rendering: optimizeLegibility;
                                    -webkit-text-size-adjust: 100%;
                                  }
                                  a {
                                    color: inherit;
                                    font-weight: 700;
                                    text-decoration: underline;
                                    text-underline-offset: 0.0925em;
                                  }            
                                  b, strong {
                                    font-weight: 700;
                                  }            
                                  i, em {
                                    font-style: italic;
                                  }            
                                  main {
                                    display: grid;
                                    gap: 1em;
                                    padding: 2em;
                                    place-items: center;
                                    text-align: center;
                                  }            
                                  main header {
                                    width: min(100%, 18em);
                                  }            
                                  main header svg {
                                    height: auto;
                                    max-width: 100%;
                                    width: 100%;
                                  }            
                                  main article {
                                    width: min(100%, 30em);
                                  }            
                                  main article p {
                                    font-size: 75%;
                                  }            
                                  main article br {            
                                    display: none;            
                                    @media(min-width: 48em) {
                                      display: inline;
                                    }            
                                  }          
            """;

    private final MessageSource messageSource;
    private final LocaleResolver<HttpRequest<?>> localeResolver;
    private final Map<LocaleStatus, String> cache = new ConcurrentHashMap<>();

    DefaultHtmlBodyErrorResponseProvider(MessageSource messageSource,
                                 LocaleResolver<HttpRequest<?>> localeResolver) {
        this.messageSource = messageSource;
        this.localeResolver = localeResolver;
    }

    @Override
    public String body(@NonNull ErrorContext errorContext, @NonNull HttpResponse<?> response) {
        final HttpStatus status = response.status();
        Locale locale = localeResolver.resolveOrDefault(errorContext.getRequest());
        return cache.computeIfAbsent(new LocaleStatus(locale, status), key -> html(locale, status, errorContext));
    }

    private String html(Locale locale, HttpStatus status, ErrorContext errorContext) {
        final String errorTitleCode = status + ".error.title";
        return MessageFormat.format("<!doctype html><html lang=\"en\"><head><title>{0} â€” {1}</title><meta charset=\"utf-8\"><meta name=\"viewport\" content=\"initial-scale=1, width=device-width\"><meta name=\"robots\" content=\"noindex, nofollow\"><style>{2}</style></head><body><main><header>{3}</header><article>{4}</article></main></body></html>",
                status.getCode(),
                messageSource.getMessage(errorTitleCode, status.getReason(), locale),
                CSS,
                SVG.get(status),
                article(locale, status, errorContext));
    }

    private String article(Locale locale, HttpStatus status, ErrorContext errorContext) {
        final String errorBoldCode = status + ".error.bold";
        final String errorCode = status + ".error";
        String defaultErrorBold = DEFAULT_ERROR_BOLD.get(status);
        String defaultError = DEFAULT_ERROR.get(status);
        String errorBold = defaultErrorBold != null ? messageSource.getMessage(errorBoldCode, defaultErrorBold, locale) : messageSource.getMessage(errorBoldCode, locale).orElse(null);
        String error = defaultError != null ? messageSource.getMessage(errorCode, defaultError, locale) : messageSource.getMessage(errorCode, locale).orElse(null);
        StringBuilder sb = new StringBuilder();

        for (io.micronaut.http.server.exceptions.response.Error e : errorContext.getErrors()) {
            if (!e.getMessage().equalsIgnoreCase(status.getReason())) {
                sb.append(e.getMessage());
                sb.append("<br/>");
            }
        }

        if (error != null || errorBold != null) {
            sb.append("<p>");
            if (errorBold != null) {
                sb.append("<strong>");
                sb.append(errorBold);
                sb.append("</strong>. ");
            }
            if (error != null) {
                sb.append(error);
                sb.append(".");
            }
            sb.append("</p>");
        }
        return sb.toString();
    }

    private record LocaleStatus(Locale locale, HttpStatus status) {

    }
